"""
	(String) 459. Repeated Substring Pattern (easy)

	Link: https://leetcode.com/problems/repeated-substring-pattern/
    
	Tags:  String, String Matching

	Constraints:
		- 1 <= s.length <= 10^4
		- s consists of lowercase English letters.
	======================================================================

	Submissions: 
		runtime: 47 ms, beats 66.14%
		memory: 16.36 MB, beats 72.08%
"""
def repeatedSubstringPattern(s):
	n = len(s)
	if n == 1: return False 
   
	for i in range(n // 2, 0, -1): 
		# print('i', i)
		if n % i == 0: 
			# print('can')
			isCan = True
			for j in range(i, (n-i) + 1, i): 
				# print('x', s[0:i], s[j:j+i])
				if s[0:i] != s[j:j+i]: 
					isCan = False
					break 
			if isCan: return True 
	return False
s1 = 'abab' # true
s2 = 'aba' # false
s3 = 'abcabcabc' # true
s4 = 'abaababaab' # true 
s5 = 'c' # false 
s6 = 'cc' # true
s7 = 'abac' # false
s8 = 'abacababacab' # true abacab abacab
s9 = ""
print('RESULT: ', repeatedSubstringPattern(s9))
